import Navbar from "../components/Navbar";
import Head from "next/head";
const Layout = (props) => {
  return (
    <div>
      <Head>
        <title>BitzPrice</title>
        <link rel="stylesheet" href="" />
      </Head>
      <Navbar />
      {props.children}
    </div>
  );
};
export default Layout;
